  {
    method: "PUT",
    headers:     
    {
      'Accept': 'application/json',
      'Authorization': "Bearer " + token,
      'Content-Type': 'application/json'
    },
    body: JSON.stringify({
        name: name
    })
  });
  const j = await response.json();

  const url="https://localhost:7003/Wish/update/name/"+id;
